import React from 'react';
import './sidenav.css';
import dashboardicon from './cityscape.png';
import pipelineicon from './deal.png';
import reporticon from './tablet.png';

const SideNav = () => {
	return (
		<nav className="sidebar">
		  <div className="navicon">
			<a href="../App.js">
			<img src={ dashboardicon } alt="Dashboard" height="auto" width="50%" />Dashboard
			</a>
		  </div>
			<a href="../App.js">
			<img src={ pipelineicon } className="navicon2" alt="Pipeline" />Pipeline
			</a>
			<a href="../App.js">
			<img src={ reporticon } className="navicon2" alt="Reports" />Reports
			</a>
		</nav>
	);
}

export default SideNav;
